import React from 'react';
import {
    StyleSheet,
    Text,
    SafeAreaView,
} from 'react-native';
import { useLocation } from 'react-router-dom';

const ProfileUser = () => {
    const location = useLocation();
    console.log(location.state);
    const data = location.state;
    return (
        <SafeAreaView style={styles.container}>
            console
            <Text style={styles.textStyle}>Username: </Text><Text style={styles.textStyle1}>{data.username}</Text>
            <Text style={styles.textStyle}>Email: </Text><Text style={styles.textStyle1}>{data.email}</Text>
            <Text style={styles.textStyle}>Hospital Name: </Text><Text style={styles.textStyle1}>{data.hospitalName}</Text>
            <Text style={styles.textStyle}>Hospital Short Name: </Text><Text style={styles.textStyle1}>{data.hospitalShortName}</Text>
            <Text style={styles.textStyle}>Hospital Address: </Text><Text style={styles.textStyle1}>{data.hospitalAdress}</Text>
            <Text style={styles.textStyle}>Hospital Tagline: </Text><Text style={styles.textStyle1}>{data.hospitalTagLine}</Text>
        </SafeAreaView>
    )
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      alignItems: 'center',
      justifyContent: 'center',
    },
    textStyle: {
        flex: 1,
        marginTop: 20,
        width: 300,
        height: 40,
        fontSize: 20,
        fontWeight: "bold",
        paddingHorizontal: 10,
    },
    textStyle1: {
        flex: 1,
        marginTop: 20,
        width: 300,
        height: 40,
        fontSize: 20,
        paddingHorizontal: 10,
    },
})

export default ProfileUser;
